import React from 'react';
import { PieChart, PieArcSeries } from 'reaviz';

/*
const dataEI = [
  { key: 'I', data: 55 },
  { key: 'E', data: 45 }
];

const dataSN = [
  { key: 'S', data: 60 },
  { key: 'N', data: 40 }
];

const dataTF = [
  { key: 'T', data: 70 },
  { key: 'F', data: 30 }
];

const dataJP = [
  { key: 'J', data: 65 },
  { key: 'P', data: 35 }
];
*/

function fetchMemberData(memberId) {
  // Example function that fetches data based on memberId
  // You should replace this with actual fetching logic from Firebase or other sources
  const mockData = {
      'member1': [
        { key: 'I', data: 75 },
        { key: 'E', data: 25 }
      ],
      'member2': [
        { key: 'I', data: 50 },
        { key: 'E', data: 50 }
      ]
  };
  return mockData[memberId];
}

const MemberChart = ({ memberData }) => (
  <div className="chart-wrapper">
      <PieChart
          width={250}
          height={250}
          data={memberData}
          series={<PieArcSeries colorScheme={['#E5E8B6', '#F6DC8D']} />}
      />
  </div>
);


const CompatabilityCharts = () => (
  <div className="chart-container">
    <div className="chart-wrapper">
      <PieChart
        width={250}
        height={250}
        data={dataEI}
        series={<PieArcSeries colorScheme={['#E5E8B6', '#F6DC8D']} />}
      />
    </div>
    <div className="chart-wrapper">
      <PieChart
        width={250}
        height={250}
        data={dataSN}
        series={<PieArcSeries colorScheme={['#BEB8EB', '#022B3A']} />}
      />
    </div>
    <div className="chart-wrapper">
      <PieChart
        width={250}
        height={250}
        data={dataTF}
        series={<PieArcSeries colorScheme={['#E3EEE2', '#ACD1E9']} />}
      />
    </div>
    <div className="chart-wrapper">
      <PieChart
        width={250}
        height={250}
        data={dataJP}
        series={<PieArcSeries colorScheme={['#F49A9A91', '#E0E0E2']} />}
      />
    </div>
  </div>
);


function NavBar() {
    return (
        <nav>
            <a href="../project-jsorror/index.html"><img src="./img/iconblue.png" alt="four circles around person" className="icon" /></a>
            <ul>
                <li><a href="../project-jsorror/index.html" aria-label="home">Home</a></li>
                <li><a href="../project-jsorror/profile.html" aria-label="profile">Profile</a></li>
                <li><a href="../project-jsorror/teams.html" aria-label="teams">Teams</a></li>
            </ul>
        </nav>
    );
}

function Header() {
    return (
        <header>
            <h1><em>tea</em><b>MBTI</b></h1>
        </header>
    );
}

function Assessment(props) {
  const titleData = props.title;
  const percentage = props.percentage;
  const kind = props.kind;
  let description = '';

  const descriptions = {
      'E': 'Extroverted',
      'I': 'Introverted',
      'S': 'Sensing',
      'N': 'Intuitive',
      'T': 'Thinking',
      'F': 'Feeling',
      'J': 'Judging',
      'P': 'Perceiving'
  };

  const first = titleData[0].key;
  const second = titleData[1].key;

  if (descriptions[first] && descriptions[first] !== kind) {
      description = descriptions[first];
  } else if (descriptions[second] && descriptions[second] !== kind) {
      description = descriptions[second];
  } else {
      description = 'no input!';
  }

  // Construct class names based on the first key of the data
  const className = first.toLowerCase() + 'circle';
  const firstLetterLower = className.replace('circle', '');

  return (
      <div className="assessment-container">
          <div className="desc" id={firstLetterLower}>
              <p>
                  You are <b>{percentage}%</b> more <b><em>{kind}</em></b> than {description}.
              </p>
          </div>
      </div>
  );
}

function Compatability() {
  return (
    <div className="mainmbti">
        <header>
            <h1 className="compheader">My MBTI Assessment</h1>
        </header>
        <div className="mbtibody">
            <CompatabilityCharts />
        </div>
        <div className="compdesc">
            <Assessment title={dataEI} percentage={75} kind="Introverted" />
            <Assessment title={dataSN} percentage={85} kind="Intuitive" />
            <Assessment title={dataTF} percentage={60} kind="Feeling" />
            <Assessment title={dataJP} percentage={60} kind="Judging" />
        </div>
    </div>
  );
}



function Footer() {
    return (
        <footer>&copy; 2024 teaMBTI</footer>
    );
}

export { NavBar, Header, Compatability, Footer };
